import Image from "assets/img";
function MbtiPicture() {

    //mbti 에 맞게 if 또는 case 해서 사진을 띄워야된다
return(
    <div>
        <img src={Image}
        alt="bg5.jpg"/>
    {/* require("assets/img/bg5.jpg") */}
